import React from "react";

const Navbar = () => {
  <header>
    <navbar>
      <ul>
        <li>TMDB</li>
        <li>Movies</li>
        <li>Tv Shows</li>
        <li>People</li>
      </ul>
    </navbar>
  </header>;
};

export default Navbar;
